import * as React from 'react';
import Box from '@mui/material/Box';
import SubHeader from '../components/subHeader'
import IconHeader from '../components/IconHeader'
import SearchBar from '../components/searchBar'
import RightIcon from '../components/rightIconsHeader'






export default function PrimarySearchAppBar() {


    return (

        <Box sx={{ flexGrow: 1 }}>
            <Box position="static" >
                <Box sx={{ height: "4rem", display: "flex", alignItem: "center", justifyContent: "space-between" }}>

                    {/* //icon header */}

                    <IconHeader />

                    {/* //search bar */}
                    <SearchBar />
                    {/* //right side icons */}
                    <RightIcon/>

                </Box>
                <Box sx={{ height: "4rem", bgcolor: "lightgrey" }}>
                    <SubHeader />
                </Box>

            </Box>

        </Box >

    );
}
